Japan Exclusive Games: ミスティックアーク / Mystic Ark
.
A Japan exclusive RPG by published by ENIX with art by Akihiko Yamada.
.
The plot of this game resolves around a protagonist who wakes up in an unknown temple. He find out that in order for him to return home, he needs to collect items called 'Arks' from various unique world connected from the temple.
.
Each world has its own story to tell and with unique characters. Gameplay-wise it is similar to any traditional JRPG. Turn based combat with random encounters.
.
This game received a sequel named Mystic Ark Maboroshi Gekijo, also exclusive to Japan. Although it has the Mystic Ark branding, the gameplay is rather different. It is a 3D puzzle adventure game rather than a JRPG. Its known amongst Japanese gamers for its infamous loud footstep noises.
.
This was also the first boxed Super Famicom game I bought with my own money and also the only game I ever emulated on pc (I was that desperate to play it 🤣 )
.
